                                    const AVDXVAContext *ctx,

                                    const AVFrame *frame)

{

    void *surface = get_surface(frame);

    unsigned i;



    for (i = 0; i < DXVA_CONTEXT_COUNT(avctx, ctx); i++) {

#if CONFIG_D3D11VA

        if (avctx->pix_fmt == AV_PIX_FMT_D3D11VA_VLD && ctx->d3d11va.surface[i] == surface)

