            D3D11_VIDEO_DECODER_OUTPUT_VIEW_DESC viewDesc;

            ID3D11VideoDecoderOutputView_GetDesc(ctx->d3d11va.surface[i], &viewDesc);

            return viewDesc.Texture2D.ArraySlice;

        }

#endif

#if CONFIG_DXVA2

